{
    "testCases": [
        {
            "description": {
                "overview": "This test case is designed to verify if the user is able to edit the article title and description on the left section of the page.",
                "steps": [
                    "Step 1: Open the Article edit page.",
                    "Step 2: Edit the Article title and description.",
                    "Step 3: Click on the 'Save' button."
                ],
                "expectedOutcome": "The article title and description should be updated successfully."
            },
            "summary": "Edit and save the article title and description.",
            "priority": "High",
            "components": "Article edit page, Article description",
            "comments": "Ensure that the page is correctly aligned after the update.",
            "labels": "Article, edit_page, Title, Description"
        },
        {
            "description": {
                "overview": "This test case is designed to verify if the user is able to change the article category from the right section of the page.",
                "steps": [
                    "Step 1: Open the Article edit page.",
                    "Step 2: Click on 'Choose category'.",
                    "Step 3: Select a category from the popup in tree format.",
                    "Step 4: Click on the 'Save' button."
                ],
                "expectedOutcome": "The article category should be updated successfully."
            },
            "summary": "Change and save the article category.",
            "priority": "High",
            "components": "Article edit page, Article category",
            "comments": "Ensure that the updated category is shown in the right section after save.",
            "labels": "Article, edit_page, Category"
        },
        {
            "description": {
                "overview": "This test case is designed to verify if the user is able to cancel the changes and the prompt works correctly.",
                "steps": [
                    "Step 1: Open the Article edit page.",
                    "Step 2: Edit the article title or description or both.",
                    "Step 3: Click on 'Cancel' button.",
                    "Step 4: In the prompt, click on 'Ignore and go back'."
                ],
                "expectedOutcome": "The page should return to the previous page and the changes should not be saved."
            },
            "summary": "Cancel changes and ignore the prompt.",
            "priority": "High",
            "components": "Article edit page, Prompt",
            "comments": "Ensure that the prompt appears when clicking on 'Cancel' button.",
            "labels": "Article, edit_page, Cancel, Prompt"
        },
        {
            "description": {
                "overview": "This test case is designed to verify if the user can cancel changes and save through the prompt.",
                "steps": [
                    "Step 1: Open the Article edit page.",
                    "Step 2: Edit the article title or description or both.",
                    "Step 3: Click on 'Cancel' button.",
                    "Step 4: In the prompt, click on 'Save and go back'."
                ],
                "expectedOutcome": "The page should return to the previous page and the changes should be saved."
            },
            "summary": "Cancel changes and save through the prompt.",
            "priority": "High",
            "components": "Article edit page, Prompt",
            "comments": "Ensure that the prompt offers the option to save changes.",
            "labels": "Article, edit_page, Cancel, Prompt, Save"
        }
    ]
}
